import React, {useState} from "react";
import {useDispatch} from "react-redux";
import axios from "axios"

function Signin(props) {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    const dispatch = useDispatch();

    const handleSubmit = () => {
        try {
            const {data} = axios.post("api/users/signin", {email, password});

            dispatch({
                type: "user_signedin_successfully",
                payload: data
            });
        }
        catch (e) {

        }
    }

    return <div className="container mt-4 d-flex justify-content-center">
                <div className="card" style={{width: "22rem"}}>
                    <div className="card-header">
                        <h4>Sign-In</h4>
                    </div>
                    <div className="card-body">
                        <form onSubmit={handleSubmit}>
                            <div className="form-group">
                                <label htmlFor="exampleFormControlInput1">Email</label>
                                <input type="email" className="form-control" id="exampleFormControlInput1"/>
                            </div>
                            <div className="form-group">
                                <label htmlFor="exampleFormControlInput1">Password</label>
                                <input type="password" className="form-control" id="exampleFormControlInput1"/>
                            </div>
                            <div className="form-group">
                                <button className="btn btn-primary btn-block">Sign In</button>
                            </div>
                            <div className="form-group">
                                <p>New to E-commerce?</p>
                                <button className="btn btn-primary btn-block">Create an account</button>
                            </div>
                        </form>
                    </div>
                </div>
    </div>
}

export default Signin
